    palette:{
      mode: "dark",
      primary:{
        main: "#fff",
      }
    }
  })

  return (
    <div>
      <ThemeProvider theme={darkTheme}>
        <TextField
          style={{ flex: 1 }}
          className="searchBox"
          label="Search"
          variant="filled"
          // onChange={(e) => setSearchText(e.target.value)}
        />
      </ThemeProvider>
    </div>
  )
}

export default Search
